T_{x\bar y}G_{x\bar y} T_{xy}G_{xy}  =\eta
\

\begin{equation} 
\hat U_{\v i,\v i+{\v x}}=-i\la^{x}_{\v i}\la^{\bar x}_{\v i+{\v x}}, \ \ \
\hat U_{\v i,\v i+{\v y}}=-i\la^{y}_{\v i}\la^{\bar y}_{\v i+{\v y}} ,\ \ \
\hat U_{\v i\v j} =  \hat U_{\v j\v i}
\

\begin{equation}
